&lt;p&gt;Abdominal aortic aneurysm&lt;/p&gt;

&lt;p&gt;&lt;img alt=&quot;Tetrahydrocannabinol (THC) cartridge ingestion - ScienceDirect&quot; src=&quot;https://ars.els-cdn.com/content/image/1-s2.0-S221357662030021X-gr1.jpg&quot; /&gt;&lt;/p&gt;

&lt;p&gt;&nbsp;&lt;/p&gt;

&lt;p&gt;THC cartridge ingestion&lt;/p&gt;

&lt;p&gt;&lt;img alt=&quot;X-ray shows how man accidentally swallowed scissors&quot; src=&quot;https://www.telegraph.co.uk/multimedia/archive/01376/scissors_1376875c.jpg&quot; /&gt;&lt;/p&gt;

&lt;p&gt;&nbsp;&lt;/p&gt;

&lt;p&gt;&nbsp;&lt;/p&gt;

&lt;p&gt;&quot;A 10-year-old boy presented with a 1-day history of recurrent vomiting and intermittent lower abdominal pain. Examination revealed lower abdominal tenderness. Inflammatory markers were normal with a negative urine dipstick. However, the child&#039;s pain worsened and he developed rebound tenderness and guarding... Anteroposterior and lateral abdominal radiographs revealed a radio-opaque, &lsquo;beaded&rsquo; foreign body&quot;&lt;/p&gt;

&lt;p&gt;&nbsp;&lt;/p&gt;

&lt;p&gt;Consumed magnet beads!! &lt;a href=&quot;https://casereports.bmj.com/content/2014/bcr-2014-208083&quot;&gt;Here&#039;s &lt;/a&gt;the case report&lt;/p&gt;

&lt;p&gt;&lt;img alt=&quot;Small Bowel Crohn Disease at CT and MR Enterography: Imaging Atlas and  Glossary of Terms | RadioGraphics&quot; src=&quot;https://pubs.rsna.org/cms/10.1148/rg.2020190091/asset/images/medium/rg.2020190091.fig3.gif&quot; /&gt;&lt;/p&gt;

&lt;p&gt;&nbsp;&lt;/p&gt;

&lt;p&gt;This is an image of someone with IBD (specifically Crohn&#039;s disease)!&lt;/p&gt;

&lt;p&gt;&lt;img alt=&quot;Thoracopagus Conjoined Twins | Circulation&quot; src=&quot;https://www.ahajournals.org/cms/asset/9cbe33db-c2dc-419e-8635-a1b8644dd154/20ff1.jpg&quot; /&gt;&lt;/p&gt;

&lt;p&gt;Conjoined twins brings abdominal anatomy to level 100000.&lt;/p&gt;

&lt;p&gt;This is referred to as&nbsp;thoracopagus conjoined twins. They are conjoined on their ventral abdominal walls, &lt;em&gt;generally&lt;/em&gt; sharing a liver and a diaphragm (unsure about the abdominal organs). Both twins have a heart that remains conjoined in an unbalanced manner. The image was taken post-mortem at an approximate gestational age of 22 weeks.&lt;/p&gt;

&lt;p&gt;Case courtesy of Jeremy Jones, &amp;lt;a href=&quot;https://radiopaedia.org/?lang=us&quot;&amp;gt;Radiopaedia.org&amp;lt;/a&amp;gt;. From the case &amp;lt;a href=&quot;https://radiopaedia.org/cases/6200?lang=us&quot;&amp;gt;rID: 6200&amp;lt;/a&amp;gt;&lt;/p&gt;

&lt;p&gt;Colonic diverticula. Cool to see this on xray!&lt;/p&gt;

&lt;p&gt;&nbsp;&lt;/p&gt;
